import React from 'react';
import { useAuth } from '../hooks/useAuth';
import { Navigate } from 'react-router-dom';
import RoadsManagement from '../components/AdminPanel/RoadsManagement';
import MunicipalitiesManagement from '../components/AdminPanel/MunicipalitiesManagement';
import IncidentsManagement from '../components/AdminPanel/IncidentsManagement';
import IncidentRequests from '../components/AdminPanel/IncidentRequests';

function VerifierPage() {
  const { user } = useAuth();
  if (!user || user.role !== 'verifier') return <Navigate to="/" />;
  
  return (
    <div>
      <h1>Panel del Verificador</h1>
      <RoadsManagement />
      <MunicipalitiesManagement />
      <IncidentsManagement />
      <IncidentRequests />
    </div>
  );
}

export default VerifierPage;
